import React from "react";

function Cards(props) {
  return (
    <div>
      <div className="card-container">
        <div className="card">
          <img src={props.link} alt={props.text} />
          <h3>{props.title}</h3>
        </div>
        <div className="card">
          <img src={props.link} alt={props.text} />
          <h3>{props.title}</h3>
        </div>
      </div>
    </div>
  );
}

export default Cards;
